import './App.css';
import Navbar from './Components/Navbar/Navbar';


function App() {
  return (
    <div>
      <BrowserRouter> 
      <Navbar/>
      <Routes>
        <Route path='/' element={<Shop/>}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
